import React from 'react';


const MyOrder = () => {
    const products = [
        { 
            image: 1, 
            name: 'Product 1', 
            author: 10 
        },
        
    ]


    const styles = {
        container: {
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            height: '100vh',
        },
    }

  return (
    <div className={styles.container}>
        <div className={styles.orderImg}>
            {/* Add your image here */}
        </div>
        
    </div>
  );
};

export default MyOrder;
